import { Divider, Grid, InputBase, Stack, Typography } from '@mui/material';

function EmploymentDetailsForm() {
  return (
    <Stack
      sx={{ span: { fontFamily: 'SVN-Sofia-Regular' }, border: '1px solid rgb(223, 227, 230)', borderRadius: '6px' }}
    >
      <Typography
        component="span"
        sx={{
          fontSize: '12px',
          color: 'rgb(104,112,118)',
          fontWeight: 600,
          padding: '5px 20px',
          backgroundColor: 'rgb(241, 243, 245)',
        }}
      >
        CONTRACT:
      </Typography>
      <Typography
        component="p"
        sx={{ fontFamily: 'SVN-Sofia-Regular', fontSize: '14px', color: 'rgb(104, 112, 118)', padding: '10px 20px' }}
      >
        Please upload pdf, png, xlsx, docx file format!
      </Typography>
      <Divider />
      <Stack sx={{ flexFlow: 'row wrap', gap: '20px', padding: '20px 14px 30px 20px' }}>
        <Stack
          component="form"
          direction="column"
          spacing={2}
          sx={{
            gap: '10px',
            display: 'flex',
            maxWidth: '350px',
            width: '100%',
          }}
        >
          <Grid
            container
            spacing={'row'}
            sx={{ '&:first-of-type': { marginLeft: '0', marginTop: 0 }, marginTop: '0 !important' }}
          >
            <Grid
              item
              xs={4}
              sx={{
                paddingLeft: '0 !important',
                paddingTop: '0 !important',
                display: 'flex',
                alignItems: 'center',
                marginTop: '0 !important',
              }}
            >
              <Typography
                variant="body2"
                gutterBottom
                sx={{
                  fontFamily: 'SVN-Sofia-Regular',
                  display: 'flex',
                  alignItems: 'center',
                  margin: 0,
                  fontSize: '16px',
                }}
              >
                Contract Date
              </Typography>
            </Grid>
            <Grid item xs={8} sx={{ paddingLeft: '0 !important', paddingTop: '0 !important' }}></Grid>
          </Grid>
          <Grid
            container
            spacing={'row'}
            sx={{ '&:first-of-type': { marginLeft: '0', marginTop: 0 }, marginTop: '0 !important' }}
          >
            <Grid
              item
              xs={4}
              sx={{
                paddingLeft: '0 !important',
                paddingTop: '0 !important',
                display: 'flex',
                alignItems: 'center',
                marginTop: '0 !important',
              }}
            >
              <Typography
                variant="body2"
                gutterBottom
                sx={{
                  fontFamily: 'SVN-Sofia-Regular',
                  display: 'flex',
                  alignItems: 'center',
                  margin: 0,
                  fontSize: '16px',
                }}
              >
                Contract Name
              </Typography>
            </Grid>
            <Grid item xs={8} sx={{ paddingLeft: '0 !important', paddingTop: '0 !important' }}>
              <InputBase
                sx={{
                  backgroundColor: 'rgb(241, 243, 245)',
                  input: { padding: '12px' },
                  borderRadius: '6px',
                  width: '100%',
                }}
              />
            </Grid>
          </Grid>
        </Stack>
      </Stack>
    </Stack>
  );
}

export default EmploymentDetailsForm;
